//Add class checked to radio button

$('.radio-price').click(function() {
	$('.radio-price').removeClass('checked');
	$(this).addClass('checked');
});
$('#price-filter .clearfilter').click(function() {
	$('.radio-price').removeClass('checked');
	return false;
});


